import React from 'react';

function DisplayName({item, handleDelete}){
    return<ul>
        {item.map((list, i)=><li key={i}>{list}<lable onClick={()=> handleDelete(i)}>&#10060;</lable></li>)} 
    </ul>
}




export default DisplayName;
